import { Link } from "react-router-dom";

import "../../index.css";
import Logo from "../../assets/ghaneiLogo.png";

const LandingPage = () => {
  return (
    <div className="landingPage">
      <nav className="navbar fixed-top bg-none flex-md-nowrap p-0">
        <Link to="/">
          <img className="logo" src={Logo} alt="Amirreza Ghanei" />
        </Link>
      </nav>
      <section>
        {/* <div className="styleDive"></div>
        <span className="arrow-top"></span>
        <span className="arrow-left"></span> */}
        <span className="arrow-top"></span>
        <span className="arrow-right"></span>
        <span className="arrow-bottom"></span>
        <span className="arrow-left"></span>
      </section>
    </div>
  );
};

export default LandingPage;
